// Retrieve the Tinify API Key from the input
const tinifyAPIKey = $(`Set Tinify API Key`).item.json.tinifyAPI;

// Retrieve base_id, table_id, and record_id
const base_id = $(`Set Image Prompt and Airtable IDs`).item.json.base_id;
const table_id = $(`Set Image Prompt and Airtable IDs`).item.json.table_id;
const record_id = $(`Set Image Prompt and Airtable IDs`).item.json.record_id;

// Ensure the API key is defined
if (!tinifyAPIKey) {
  throw new Error('Tinify API Key is missing!');
}

// Generate the Base64-encoded authorization string
const base64EncodedKey = Buffer.from(`api:${tinifyAPIKey}`).toString('base64');

// Ensure base_id, table_id, and record_id are defined
if (!base_id || !table_id || !record_id) {
  throw new Error('One or more Airtable IDs are missing (base_id, table_id, or record_id)!');
}

// Return the Authorization key and Airtable IDs as output
return {
  Authorization: `Basic ${base64EncodedKey}`,
  base_id,
  table_id,
  record_id,
};

